import React from 'react'


export default function  Incio({data}){
  return (
              <div>
                    <br></br>

                    <div>
                    <h1>API START WARS</h1>  
                    </div>

              <h5 className="card-title">Personajes</h5>
              <p  className="card-text" >Lista de Personajes</p>

               {data.map((personaje,i)=>{

                  return(
                      <div key={i}>

                            <div className="card-columns">

                                  <div      className="card" style={{ width: "18rem" }}>
                                    <img    className="card-img-top"  src="..."  alt="..."/>
                                      <div  className="card-body">
                                        <h5 className="card-title">{personaje.name}</h5>
                                        <h1 className="card-subtitle">Estatura: {personaje.height}</h1>
                                        <p  className="card-text"></p>
                                    </div>
                                  </div>

                             </div>


                      </div>

                  )

               })} 

              </div>

              )








